import React from 'react';

class Link extends React.Component {
  constructor(props) {
  	super(props);
  	this.state = {
  	  to: this.props.to
  	}
  }
  render() {
    return(
      <a href={ this.props.to }></a>
    )
  }
}

export default Link;
